const Contact = (props) => {
  return (
    <div
      className="row p-md-2 md-2"
      style={{ borderRadius: "20px", border: "1px solid #555" }}
    >
      <div className="col-2 col-md-1 pt-2 pt-md-1">
        <img
          src={'https://ui-avatars.com/api/?name=${props.contact.name}'}
          style={{ width: "80%" }}
          alt=""
        />
      </div>
      <button className="btn btn-secondary from-control">
        {props.contact.name}
      </button>
    </div>
  );
}; 
export default Contact;
